import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container'
import Paper from '@mui/material/Paper'

export default function customer() {
    const paperstyle={padding:'50px 20px', width:800, margin:'20px auto'}
  return (
    <Container>
        <Paper elevation={3} style={paperstyle}>
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1},
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Customer ID" variant="standard" />
      <TextField id="filled-basic" label="Customer Firstname" variant="filled" fullWidth />
      <TextField id="standard-basic" label="Customer Lastname" variant="outlined" />
    </Box>
    </Paper>
    </Container>
  );
}
